import React from 'react'
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Homepage from './components/Homepage'
import Shop from './components/Shop';


function App() {
  return (
    <div>
      <Homepage></Homepage>
      <Routes>
          <Route path="/shop" element={<Shop />} />
</Routes>

    </div>
  )
}

export default App
